import React from "react";
import useInput from "../hooks/useInput";
import { useHistory } from "react-router-dom";
import axios from "axios";
const Login = () => {
  const dispatch= useDispat()
  const email = useInput();
  const password = useInput();
  const history = useHistory();
  const handleSumbit = (e) => {
    e.preventDefault();

    axios
      .post("/api/login", {
        email: email.value,
        password: password.value,
      })
      .then((data) => {
        if (data.status === 200) {
          history.push("/inicio");
        }
      })
      .catch(() =>
        alert(
          "Lo siento, no se pudo iniciar sesion comprueba correo y/o contraseña"
        )
      );
  };

  return (
    <div className="centrado  pading">
      <h1 className="color fav">Hola de nuevo!</h1>
      <div className="">
        <form onSubmit={handleSumbit} className=" pading fav">
          <label className="label my-3 color">Email</label>
          <br />
          <input {...email} type="email" />
          <br />
          <label className="label my-3 color">Password</label>
          <br />
          <input {...password} type="password" />
          <br />
          <button className="button is-link my-5">Submit</button>
        </form>
      </div>
    </div>
  );
};

export default Login;
